// Registry of registered securities
// (c) Kallol Borah, 2021

pragma solidity 0.5.7;

import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/upgrades/contracts/upgradeability/ProxyFactory.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";
import "../interfaces/ISecuritiesRegistry.sol";
import "../interfaces/IPoolFactory.sol";
import "../interfaces/ViaFactory.sol";

contract SecuritiesRegistry is Initializable, Ownable, ProxyFactory, ISecuritiesRegistry{

    ViaFactory private via;

    address poolFactory;
    address preTradeContract;
    address tradeContract;
    address postTradeContract;

    struct security{
        bytes32 company;
        bytes32 currency;
        bytes32 isin;
    }

    mapping(address => security) private securityTokens;

    address[] private tokens;
    
    //event signalling creation of a security token
    event SecurityCreated(address indexed _token, bytes32 _company, bytes32 _isin);

    function initialize(address _viaFactory, address _poolFactory, address _preTradeContract, address _tradeContract, address _postTradeContract) public initializer{
        Ownable.initialize(msg.sender);
        via = ViaFactory(_viaFactory);
        poolFactory = _poolFactory;
        preTradeContract = _preTradeContract;
        tradeContract = _tradeContract;
        postTradeContract = _postTradeContract;
    }

    function createSecurity(address _security, bytes32 _currency, bytes32 _company, bytes32 _isin) external {
        require(msg.sender==preTradeContract);
        address cash = via.getTokenByNameType(_currency, "ViaCash");
        require(cash!=address(0x0));
        
        if(!isRegistered(_company, _currency, _isin)){
            bytes memory _payload = abi.encodeWithSignature("initialize(bytes32, bytes32)", _company, _isin, preTradeContract, tradeContract, postTradeContract);

            address _token = deployMinimal(_security, _payload);
            emit SecurityCreated(_token, _company, _isin);

            securityTokens[_token] = security(_company, _currency, _isin);
            tokens.push(_token);

            IPoolFactory(poolFactory).createPool(_token, cash, _currency, "DP");
        }
    }

    function isRegistered(bytes32 _company, bytes32 _currency, bytes32 _isin) private view returns(bool){
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].company==_company &&
                securityTokens[tokens[i]].currency==_currency &&
                securityTokens[tokens[i]].isin==_isin)
                    return true;
        }
        return false;
    }

    function getToken(bytes32 _currency, bytes32 _company, bytes32 _isin) external view returns(address){
        //require(msg.sender==preTradeContract);
        for(uint i=0; i<tokens.length; i++){
            if( securityTokens[tokens[i]].currency==_currency &&
                securityTokens[tokens[i]].company==_company &&
                securityTokens[tokens[i]].isin==_isin){
                    return tokens[i];
            }
        }
    }

}
